lockfileVersion: '9.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

importers:

  .:
    dependencies:
      atomu:
        specifier: file:..
        version: file:..

packages:

  atomu@file:..:
    resolution: {directory: .., type: directory}

snapshots:

  atomu@file:..: {}
